	$checkboxSelectAll_CheckedChanged = {
		#TODO: Place custom script here
		#$uiTimer.Enabled = $true
		#$uiTimer.Start()
		if ($checkboxSelectAll.CheckState -eq 'Unchecked')
		{
			$checkboxUpdateRemoteManagement.CheckState = 'Unchecked'
			$checkboxUpdateLocalManagement.CheckState = 'Unchecked'
			$checkboxUpdateRelatedSQLData.CheckState = 'Unchecked'
			$checkboxUpdateOperationsMana.CheckState = 'Unchecked'
			$checkboxClearSCOMCache.CheckState = 'Unchecked'
			
			For ($i = 0; $i -lt $checkedlistboxManagementServers.Items.Count; $i++)
			{
				$checkedlistboxManagementServers.SetItemChecked($i, $False)
			}
			$checkedlistboxManagementServers_SelectedIndexChanged.Invoke()
		}
		elseif ($checkboxSelectAll.CheckState -eq 'Checked')
		{
			$checkboxUpdateRelatedSQLData.CheckState = 'Checked'
			$checkboxClearSCOMCache.CheckState = 'Checked'
			$checkboxUpdateOperationsMana.CheckState = 'Checked'
			
			For ($i = 0; $i -lt $checkedlistboxManagementServers.Items.Count; $i++)
			{
				$checkedlistboxManagementServers.SetItemChecked($i, $True)
			}
			$checkboxUpdateRemoteManagement.CheckState = 'Checked'
			$checkboxUpdateLocalManagement.CheckState = 'Checked'
		}
		else
		{
			if ($remoteMS.Count -ge 1)
			{
				$checkboxUpdateRemoteManagement.CheckState = 'Checked'
			}
			elseif ($remoteMS.Count -eq 0)
			{
				$checkboxUpdateRemoteManagement.CheckState = 'Unchecked'
			}
			if ($localMS.Count -ge 1)
			{
				$checkboxUpdateLocalManagement.CheckState = 'Checked'
			}
			elseif ($localMS.Count -eq 0)
			{
				$checkboxUpdateLocalManagement.CheckState = 'Unchecked'
			}
			if ($checkedlistboxManagementServers.Items.Count -gt 0)
			{
				$checkedlistboxManagementServers.SelectedIndex = 0
			}
			
			$checkboxUpdateRelatedSQLData.CheckState = 'Unchecked'
			$checkboxUpdateOperationsMana.CheckState = 'Unchecked'
			$checkboxClearSCOMCache.CheckState = 'Unchecked'
		}
		Check-StartRequirements
	}
	
	$removeMSButton_Click = {
		#TODO: Place custom script here
		$uiTimer.Enabled = $true
		$error.clear
		$MSTextboxText = $null
		try
		{
			ForEach ($i in $checkedlistboxManagementServers.Items)
			{
				if ($i -in $checkedlistboxManagementServers.SelectedItem.ToString())
				{
					$MSTextboxText = $i
					
					try { $checkedlistboxManagementServers.Items.Remove($MSTextboxText) }
					catch { Write-Verbose "Unable to Add Item." }
					$ManagementServerTextBox.Text = $MSTextboxText
				}
				else
				{
					continue
				}
			}
		}
		catch
		{
			Write-Verbose "Experienced exception while removing the Management Server from the list. Error: $error"
		}
		
		if ($ManagementServerTextBox.Text -in $checkedlistboxManagementServers.Items)
		{
			$addMSButton.Enabled = $false
		}
		else
		{
			$addMSButton.Enabled = $true
		}
		
		if ($checkedlistboxManagementServers.Items.Count -gt 0)
		{
			$checkedlistboxManagementServers.SelectedIndex = 0
			$buttonViewConfigurationFile.Enabled = $true
			$buttonViewRelatedRegistryData.Enabled = $true
		}
		else
		{
			$buttonViewConfigurationFile.Enabled = $false
			$buttonViewRelatedRegistryData.Enabled = $false
		}
		Check-StartRequirements
	}
	
