		}
		$ManagementServerTextBox.Text = $checkedlistboxManagementServers.SelectedItem
		$script:localMS = @()
		$script:remoteMS = @()
		
		if ($checkedlistboxManagementServers.Items.Count -gt 0)
		{
			foreach ($checkedMS in $checkedlistboxManagementServers.CheckedItems)
			{
				if (($checkedMS.ToString().Split(".")[0] -eq "$env:COMPUTERNAME") -or ($checkedMS -eq "$([System.Net.Dns]::GetHostByName($env:COMPUTERNAME).HostName)"))
				{
					$script:localMS += $checkedMS
				}
				else
				{
					$script:remoteMS += $checkedMS
				}
			}
			$buttonViewConfigurationFile.Enabled = $true
			$buttonViewRelatedRegistryData.Enabled = $true
		}
		
		if ($script:remoteMS.Count -ge 1)
		{
			$checkboxUpdateRemoteManagement.CheckState = 'Checked'
			$buttonViewConfigurationFile.Enabled = $true
			$buttonViewRelatedRegistryData.Enabled = $true
		}
		elseif ($script:remoteMS.Count -eq 0)
		{
			$checkboxUpdateRemoteManagement.CheckState = 'Unchecked'
		}
		if ($script:localMS.Count -ge 1)
		{
			$checkboxUpdateLocalManagement.CheckState = 'Checked'
		}
		elseif ($script:localMS.Count -eq 0)
		{
			$checkboxUpdateLocalManagement.CheckState = 'Unchecked'
		}
