					$errorprovider2.SetError($ManagementServerTextBox, 'En az bir Management Server ekleyin ve kontrol edin.')
				}
				# Chinese (中国人)
				'4'
				{
					$errorprovider2.SetError($ManagementServerTextBox, '添加并检查至少一个管理服务器。')
				}
				# Portuguese (Português)
				'5'
