		$Error.Clear()
		Add-JobTracker -ArgumentList $opsMgrSQLInstanceTextBox.Text, $opsMgrSQLDBTextBox.Text, $invokeSQLFunction -Name 'TestSQLConnection_OpsDB' `
					   -JobScript {
			Param ($ServerInstance,
				$DatabaseName,
				$script) #Pass any arguments using the ArgumentList parameter
