			#Important: Do not access form controls from this script block.
			Invoke-SqlCommand -ServerInstance $ServerInstance -Database $DatabaseName -Query "SELECT 1" -As DataRow
			exit 0
		}`
					   -CompletedScript {
			Param ($Job)
			$buttonTestConnectionOpsDB.Cursor = 'Default'
