				$buttonStart.Enabled = $false
				Write-ActivityLog "Unable to test connection to:`n`t`t`t`tOperations Manager SQL Server: $($opsMgrSQLInstanceTextBox.Text)`n`t`t`t`tOperations Manager Database: $($opsMgrSQLDBTextBox.Text)`n`t`t`t`t$($error[0])" -IsError
			}
		}`
