	#--------------------------------------------
	# Declare Global Variables and Functions here
	#--------------------------------------------
	$ScriptMoveVersion = '2.5.0.0'
	
	function Get-TimeStamp
	{
		$TimeStamp = (Get-Date).ToLongTimeString()
		return "$TimeStamp - "
	}
	
	function Write-ActivityLog
	{
		param
		(
			[Parameter(Mandatory = $true)]
			[string]$Text,
			[switch]$NoConsoleOutput,
			[switch]$IsError
		)
		
		if ($richtextboxScriptOutput.Text -notmatch ("$((Get-Date).ToLongDateString())"))
		{
			Write-Host "$((Get-Date).ToLongDateString())"
			$richtextboxScriptOutput.AppendText("$((Get-Date).ToLongDateString())`n")
		}
		$richtextboxScriptOutput.AppendText("$(Get-TimeStamp)$Text`n")
		if (!$NoConsoleOutput)
		{
			Write-Host "$(Get-TimeStamp)$Text"
		}
		else
		{
			Write-Host "$(Get-TimeStamp)"
		}
		if ($IsError)
		{
			Write-EventLog -LogName Application -Source 'SCOMDBMoveTool' -EventID 40 -Message "$(Get-TimeStamp)$Text" -EntryType Error
		}
		else
		{
			Write-EventLog -LogName Application -Source 'SCOMDBMoveTool' -EventID 10 -Message "$(Get-TimeStamp)$Text" -EntryType Information
		}
	}
	$WriteActivityLogFunction = "function Get-TimeStamp { ${function:Get-TimeStamp} }; function Write-ActivityLog { ${function:Write-ActivityLog} }"
	
	function Get-ManagementServer
	{
		param
		(
			[switch]$GatherRegistry
		)
		
		$ManagementServers = @()
		$failureOccurred = $false
		$Error.Clear()
		try
		{
			Write-ActivityLog "Gathering Management Servers list with 'Get-SCOMManagementServer'!"
			$SCOMPowerShellKey = "HKLM:\SOFTWARE\Microsoft\System Center Operations Manager\12\Setup\Powershell\V2"
			$SCOMModulePath = Join-Path (Get-ItemProperty $SCOMPowerShellKey -ErrorAction Stop).InstallDirectory "OperationsManager" -ErrorAction Stop
			Import-module $SCOMModulePath
			$ManagementServers += (Get-SCOMManagementServer | Where-Object { $_.IsGateway -eq $false }).DisplayName | Sort-Object
			$checkedlistboxManagementServers.Items.Clear()
			$ManagementServers | ForEach-Object { $checkedlistboxManagementServers.Items.Add($_, $true) }
			For ($i = 0; $i -lt $checkedlistboxManagementServers.Items.Count; $i++)
			{
				$checkedlistboxManagementServers.SetItemChecked($i, $True)
			}
			
			$checkedlistboxManagementServers_SelectedIndexChanged.Invoke()
			$checkedlistboxManagementServers.SelectedIndex = 0
			Write-ActivityLog "Gathered Management Servers list successfully!"
		}
		catch
		{
			$failureOccurred = $true
			Write-ActivityLog "Unable to load Management Servers with: 'Get-SCOMManagementServer'`n`t`t$error"
		}
		
		
		if ($GatherRegistry)
		{
			$Error.Clear()
			try
			{
				Write-ActivityLog "Gathering registry information from: 'HKLM:\SOFTWARE\Microsoft\Microsoft Operations Manager\3.0\Setup'"
				$opsMgrSetupRegKey = Get-ItemProperty -Path 'HKLM:\SOFTWARE\Microsoft\Microsoft Operations Manager\3.0\Setup' -ErrorAction Stop
				
				$opsMgrSQLInstanceTextBox.Text = $opsMgrSetupRegKey.DatabaseServerName
				$opsMgrSQLDBTextBox.Text = $opsMgrSetupRegKey.DatabaseName
				$opsMgrDWSQLInstanceTextBox.Text = $opsMgrSetupRegKey.DataWarehouseDBServerName
				$opsMgrDWSQLDBTextBox.Text = $opsMgrSetupRegKey.DataWarehouseDBName
				
				$buttonViewDatabaseConfiguration.Enabled = $true
				Write-ActivityLog 'Gathered the registry information successfully!'
				$buttonGenerateList.ImageIndex = 6
			}
			catch
			{
				Write-ActivityLog "Unable to gather the Database information and Config File Location via the Registry: 'HKLM:\SOFTWARE\Microsoft\Microsoft Operations Manager\3.0\Setup'"
				$buttonViewDatabaseConfiguration.Enabled = $false
			}
		}
		if ($failureOccurred)
		{
			$Error.Clear()
			try
			{
				$ManagementServers = $null
				Write-ActivityLog "Attempting to gather Management Servers list from SQL Query to the Operations Manager Database."
				$initialOutput = Invoke-SqlCommand -ServerInstance $opsMgrSQLInstanceTextBox.Text -Database $opsMgrSQLDBTextBox.Text -Query @"
SELECT mtv.DisplayName
FROM MTV_HealthService mtv
WHERE mtv.IsManagementServer = 1 AND mtv.IsGateway = 0 AND mtv.IsAgent = 0
ORDER BY mtv.DisplayName
"@ -As DataRow -ErrorAction SilentlyContinue
					$ManagementServers += $initialOutput.DisplayName
			}
			catch
			{
				Write-ActivityLog "Unable to gather the Management Servers from the Operations Manager Database.`n$error"
			}
			
			if ($ManagementServers)
			{
				$checkedlistboxManagementServers.Items.Clear()
				$ManagementServers | ForEach-Object { $checkedlistboxManagementServers.Items.Add($_, $true) }
				For ($i = 0; $i -lt $checkedlistboxManagementServers.Items.Count; $i++)
				{
					$checkedlistboxManagementServers.SetItemChecked($i, $True)
				}
				
				$checkedlistboxManagementServers_SelectedIndexChanged.Invoke()
				$checkedlistboxManagementServers.SelectedIndex = 0
				$buttonGenerateList.ImageIndex = 6
				Write-ActivityLog "Gathered the Management Server list from System Center Operations Manager SQL Database successfully!"
			}
			else
			{
				$buttonGenerateList.ImageIndex = 8
			}
			
		}
	}
	
	function Check-StartRequirements
	{
		$uiTimer.Stop()
		$uiTimer.Enabled = $true
		$uiTimer.Start()
		
		# Determine the state of the 'Select All' checkbox
		if (!$checkboxUpdateLocalManagement.Checked -and !$checkboxUpdateRemoteManagement.Checked -and !$checkboxUpdateRelatedSQLData.Checked -and !$checkboxClearSCOMCache.Checked -and !$checkboxUpdateOperationsMana.Checked)
		{
			$checkboxSelectAll.CheckState = 'Unchecked'
		}
		elseif ($checkboxUpdateLocalManagement.Checked -and $checkboxUpdateRemoteManagement.Checked -and $checkboxUpdateRelatedSQLData.Checked -and $checkboxClearSCOMCache.Checked -and $checkboxUpdateOperationsMana.Checked)
		{
			$checkboxSelectAll.CheckState = 'Checked'
		}
		else
		{
			$checkboxSelectAll.CheckState = 'Indeterminate'
		}
		
		if ($checkedlistboxManagementServers.CheckedItems.Count -eq 0)
		{
			$checkboxUpdateLocalManagement.Checked = $false
			$checkboxUpdateRemoteManagement.Checked = $false
			$checkedMS = $false
		}
		else
		{
			$checkedMS = $true
		}
		
		# Determine the state and background color of the 'Start' button
		if ($checkedMS -eq $false -or $checkboxSelectAll.CheckState -eq 'Unchecked')
		{
			$buttonStart.Enabled = $false
			$buttonStart.BackColor = 'Gray'
		}
		elseif ($checkedMS -eq $true)
		{
			$buttonStart.Enabled = $true
			$buttonStart.BackColor = 'Lime'
		}	
	}
	
	#region Job Tracker
	$JobTrackerList = New-Object System.Collections.ArrayList
	function Add-JobTracker
	{
		<#
			.SYNOPSIS
				Add a new job to the JobTracker and starts the timer.
		
			.DESCRIPTION
				Add a new job to the JobTracker and starts the timer.
		
			.PARAMETER  Name
				The name to assign to the job.
		
			.PARAMETER  JobScript
				The script block that the job will be performing.
				Important: Do not access form controls from this script block.
		
			.PARAMETER ArgumentList
				The arguments to pass to the job.
		
			.PARAMETER  CompletedScript
				The script block that will be called when the job is complete.
				The job is passed as an argument. The Job argument is null when the job fails.
		
			.PARAMETER  UpdateScript
				The script block that will be called each time the timer ticks.
				The job is passed as an argument. Use this to get the Job's progress.
		
			.EXAMPLE
				Add-JobTracker -Name 'JobName' `
				-JobScript {	
					Param($Argument1)#Pass any arguments using the ArgumentList parameter
					#Important: Do not access form controls from this script block.
					Get-CIMInstance Win32_Process -Namespace "root\CIMV2"
				}`
				-CompletedScript {
					Param($Job)		
					$results = Receive-Job -Job $Job
				}`
				-UpdateScript {
					Param($Job)
					#$results = Receive-Job -Job $Job -Keep
				}
		
			.LINK
				
		#>
		
		Param (
			[ValidateNotNull()]
			[Parameter(Mandatory = $true)]
			[string]$Name,
			[ValidateNotNull()]
			[Parameter(Mandatory = $true)]
			[ScriptBlock]$JobScript,
			$ArgumentList = $null,
			[ScriptBlock]$CompletedScript,
			[ScriptBlock]$UpdateScript)
		
		#Start the Job
		$job = Start-Job -Name $Name -ScriptBlock $JobScript -ArgumentList $ArgumentList
		
		if ($null -ne $job)
		{
			#Create a Custom Object to keep track of the Job & Script Blocks
			$members = @{
				'Job'		     = $Job;
				'CompleteScript' = $CompletedScript;
				'UpdateScript'   = $UpdateScript
			}
			
			$psObject = New-Object System.Management.Automation.PSObject -Property $members
			
			[void]$JobTrackerList.Add($psObject)
			
			#Start the Timer
			if (-not $timerJobTracker.Enabled)
			{
				$timerJobTracker.Start()
			}
		}
		elseif ($null -ne $CompletedScript)
		{
			#Failed
			Invoke-Command -ScriptBlock $CompletedScript -ArgumentList $null
		}
		
	}
	
	function Update-JobTracker
	{
		<#
			.SYNOPSIS
				Checks the status of each job on the list.
		#>
		
		#Poll the jobs for status updates
		$timerJobTracker.Stop() #Freeze the Timer
		
		for ($index = 0; $index -lt $JobTrackerList.Count; $index++)
		{
			$psObject = $JobTrackerList[$index]
			
			if ($null -ne $psObject)
			{
				if ($null -ne $psObject.Job)
				{
					if ($psObject.Job.State -eq 'Blocked')
					{
						#Try to unblock the job
						Receive-Job $psObject.Job | Out-Null
					}
					elseif ($psObject.Job.State -ne 'Running')
					{
						#Call the Complete Script Block
						if ($null -ne $psObject.CompleteScript)
						{
							#$results = Receive-Job -Job $psObject.Job
							Invoke-Command -ScriptBlock $psObject.CompleteScript -ArgumentList $psObject.Job
						}
						
						$JobTrackerList.RemoveAt($index)
						Remove-Job -Job $psObject.Job -ErrorAction SilentlyContinue
						$index-- #Step back so we don't skip a job
					}
					elseif ($null -ne $psObject.UpdateScript)
					{
						#Call the Update Script Block
						Invoke-Command -ScriptBlock $psObject.UpdateScript -ArgumentList $psObject.Job
					}
				}
			}
			else
			{
				$JobTrackerList.RemoveAt($index)
				$index-- #Step back so we don't skip a job
			}
		}
		
		if ($JobTrackerList.Count -gt 0)
		{
			$timerJobTracker.Start() #Resume the timer
		}
	}
	
	function Stop-JobTracker
	{
		<#
			.SYNOPSIS
				Stops and removes all Jobs from the list.
		#>
		#Stop the timer
		$timerJobTracker.Stop()
		
		#Remove all the jobs
		while ($JobTrackerList.Count -gt 0)
		{
			$job = $JobTrackerList[0].Job
			$JobTrackerList.RemoveAt(0)
			Stop-Job $job -ErrorAction SilentlyContinue
			Remove-Job $job -ErrorAction SilentlyContinue
		}
	}
	#endregion Job Tracker
	
