	#Sample function that provides the location of the script
	function Get-ScriptDirectory
	{
	<#
		.SYNOPSIS
			Get-ScriptDirectory returns the proper location of the script.
	
		.OUTPUTS
			System.String
		
		.NOTES
			Returns the correct path within a packaged executable.
	#>
		[OutputType([string])]
		param ()
		if ($null -ne $hostinvocation)
		{
			try
			{
				Split-Path $hostinvocation.MyCommand.path
			}
			catch
			{
				Write-Verbose "No Path found: Split-Path `$hostinvocation.MyCommand.path"
			}
		}
		else
		{
			try
			{
				Split-Path $script:MyInvocation.MyCommand.Path
			}
			catch
			{
				Write-Verbose "No Path found: `$script:MyInvocation.MyCommand.Path"
			}
			
		}
	}
	
	#Sample variable that provides the location of the script
	[string]$ScriptDirectory = Get-ScriptDirectory
	
	<#
			.SYNOPSIS
				Executes an SQL statement. Executes using Windows Authentication unless the Username and Password are provided.
			
			.DESCRIPTION
				A detailed description of the Invoke-SqlCommand function.
			
			.PARAMETER ServerInstance
				The SQL Server instance name.
			
			.PARAMETER Database
				The SQL Server database name where the query will be executed.
			
			.PARAMETER Timeout
				The connection timeout.
			
			.PARAMETER Connection
				The System.Data.SqlClient.SQLConnection instance used to connect.
			
			.PARAMETER Username
				The SQL Authentication Username.
			
			.PARAMETER Password
				The SQL Authentication Password.
			
			.PARAMETER CommandType
				The System.Data.CommandType value specifying Text or StoredProcedure.
			
			.PARAMETER Query
				The SQL query to execute.
			
			.PARAMETER Path
				The path to an SQL script.
			
			.PARAMETER Parameters
				Hashtable containing the key value pairs used to generate as collection of System.Data.SqlParameter.
			
			.PARAMETER As
				Specifies how to return the result.
				
				PSCustomObject
				- Returns the result set as an array of System.Management.Automation.PSCustomObject objects.
				DataSet
				- Returns the result set as an System.Data.DataSet object.
				DataTable
				- Returns the result set as an System.Data.DataTable object.
				DataRow
				- Returns the result set as an array of System.Data.DataRow objects.
				Scalar
				- Returns the first column of the first row in the result set. Should be used when a value with no column name is returned (i.e. SELECT COUNT(*) FROM Test.Sample).
				NonQuery
				- Returns the number of rows affected. Should be used for INSERT, UPDATE, and DELETE.
			
			.EXAMPLE
				PS C:\> Invoke-SqlCommand -Server "DATASERVER" -Database "Web" -Query "SELECT TOP 1 * FROM Test.Sample"
				
				datetime2         : 1/17/2013 8:46:22 AM
				ID                : 202507
				uniqueidentifier1 : 1d0cf1c0-9fb1-4e21-9d5a-b8e9365400fc
				bool1             : False
				datetime1         : 1/17/2013 12:00:00 AM
				double1           : 1
				varchar1          : varchar11
				decimal1          : 1
				int1              : 1
				
				Returned the first row as a System.Management.Automation.PSCustomObject.
			
			.EXAMPLE
				PS C:\> Invoke-SqlCommand -Server "DATASERVER" -Database "Web" -Query "SELECT COUNT(*) FROM Test.Sample" -As Scalar
				
				9544
			
			.NOTES
				Additional information about the function.
		#>
	function Invoke-SqlCommand
	{
		[CmdletBinding(DefaultParameterSetName = 'Default')]
		param
		(
			[Parameter(Mandatory = $true,
					   Position = 0)]
			[string]$ServerInstance,
			[Parameter(Mandatory = $true,
					   Position = 1)]
			[string]$Database,
			[Parameter(Mandatory = $false,
					   Position = 2)]
			[int]$Timeout = 30,
			[System.Data.SqlClient.SQLConnection]$Connection,
			[string]$Username,
			[string]$Password,
			[System.Data.CommandType]$CommandType = [System.Data.CommandType]::Text,
			[string]$Query,
			[ValidateScript({ Test-Path -Path $_ })]
			[string]$Path,
			[hashtable]$Parameters,
			[ValidateSet('DataSet', 'DataTable', 'DataRow', 'PSCustomObject', 'Scalar', 'NonQuery')]
			[string]$As = "PSCustomObject"
		)
		
		begin
		{
			<#
			trap
			{
				$ErrorDetails = @"
	
	User:
	$([System.Security.Principal.WindowsIdentity]::GetCurrent().Name)
	
	Error Details:
	$($Error[0])
	
	SQL Query:
	$Query
	"@
				Write-EventLog -LogName Application -Source 'SCOMDBMoveTool' -EventID 11 -Message "Encountered exception while attempting to run SQL Query:`n$ErrorDetails" -EntryType Error
				Write-Warning "Encountered exception while running SQL Query: $ErrorDetails"
				
				[void][System.Reflection.Assembly]::LoadWithPartialName("Microsoft.VisualBasic")
				[Microsoft.VisualBasic.Interaction]::MsgBox(@"
	Event ID:
	11
	
	User:
	$([System.Security.Principal.WindowsIdentity]::GetCurrent().Name)
	
	Error Details:
	$($Error[0])
	
	For more details see the Application Event Log. (Event ID: 11)
	"@, "OKOnly,SystemModal,Critical,DefaultButton2", "Encountered exception while attempting to run SQL Query") | Out-Null
			}
			#>
			if ($Path)
			{
				$Query = [System.IO.File]::ReadAllText("$((Resolve-Path -Path $Path).Path)")
			}
			else
			{
				if (-not $Query)
				{
					throw (New-Object System.ArgumentNullException -ArgumentList "Query", "The query statement is missing.")
				}
			}
			
			$createConnection = (-not $Connection)
			
			if ($createConnection)
			{
				$Connection = New-Object System.Data.SqlClient.SQLConnection
				if ($Username -and $Password)
				{
					$Connection.ConnectionString = "Server=$($ServerInstance);Database=$($Database);User Id=$($Username);Password=$($Password);"
				}
				else
				{
					$Connection.ConnectionString = "Server=$($ServerInstance);Database=$($Database);Integrated Security=SSPI;"
				}
				if ($PSBoundParameters.Verbose)
				{
					$Connection.FireInfoMessageEventOnUserErrors = $true
					$Connection.Add_InfoMessage([System.Data.SqlClient.SqlInfoMessageEventHandler] { Write-Verbose "$($_)" })
				}
			}
			
			if (-not ($Connection.State -like "Open"))
			{
				try { $Connection.Open() }
				catch [Exception] { throw $_ }
			}
		}
		
		process
		{
			$command = New-Object System.Data.SqlClient.SqlCommand ($query, $Connection)
			$command.CommandTimeout = $Timeout
			$command.CommandType = $CommandType
			if ($Parameters)
			{
				foreach ($p in $Parameters.Keys)
				{
					$command.Parameters.AddWithValue($p, $Parameters[$p]) | Out-Null
				}
			}
			
			$scriptBlock = {
				$result = @()
				$reader = $command.ExecuteReader()
				if ($reader)
				{
					$counter = $reader.FieldCount
					$columns = @()
					for ($i = 0; $i -lt $counter; $i++)
					{
						$columns += $reader.GetName($i)
					}
					
					if ($reader.HasRows)
					{
						while ($reader.Read())
						{
							$row = @{ }
							for ($i = 0; $i -lt $counter; $i++)
							{
								$row[$columns[$i]] = $reader.GetValue($i)
							}
							$result += [PSCustomObject]$row
						}
					}
				}
				$result
			}
			
			if ($As)
			{
				switch ($As)
				{
					"Scalar" {
						$scriptBlock = {
							$result = $command.ExecuteScalar()
							$result
						}
					}
					"NonQuery" {
						$scriptBlock = {
							$result = $command.ExecuteNonQuery()
							$result
						}
					}
					default {
						if ("DataSet", "DataTable", "DataRow" -contains $As)
						{
							$scriptBlock = {
								$ds = New-Object System.Data.DataSet
								$da = New-Object System.Data.SqlClient.SqlDataAdapter($command)
								$da.Fill($ds) | Out-Null
								switch ($As)
								{
									"DataSet" { $result = $ds }
									"DataTable" { $result = $ds.Tables }
									default { $result = $ds.Tables | ForEach-Object -Process { $_.Rows } }
								}
								$result
							}
						}
					}
				}
			}
			$Error.Clear()
			try
			{
				$result = Invoke-Command -ScriptBlock $ScriptBlock -ErrorAction Stop
			}
			catch
			{
				$ErrorDetails = @"

User:
	$([System.Security.Principal.WindowsIdentity]::GetCurrent().Name)

Error Details:
	$Error

SQL Query:
	$Query
"@
				Write-ActivityLog "Encountered exception while running SQL Query: $ErrorDetails" -IsError
				
				Add-Type -AssemblyName PresentationCore, PresentationFramework
				$ButtonType = [System.Windows.MessageBoxButton]::OK
				$MessageIcon = [System.Windows.MessageBoxImage]::Error
				$MessageBody = @"
Event ID:
40

User:
	$([System.Security.Principal.WindowsIdentity]::GetCurrent().Name)

Error Details:
	$Error

For more details see the Application Event Log (Event ID: 40).
"@
				$MessageTitle = "Encountered exception while attempting to run SQL Query"
				$Result = [System.Windows.MessageBox]::Show($MessageBody, $MessageTitle, $ButtonType, $MessageIcon)
			}
			$command.Parameters.Clear()
		}
		
		end
		{
			if ($createConnection) { $Connection.Close() }
			$command.Dispose()
			$Connection.Dispose()
			$result
		}
	}
	$invokeSQLFunction = "function Invoke-SQLCommand { ${function:Invoke-SQLCommand} }"
	
	function Format-XML
	{
		[CmdletBinding()]
		Param ([Parameter(ValueFromPipeline = $true, Mandatory = $true)]
			[string]$xmlcontent)
		$xmldoc = New-Object -TypeName System.Xml.XmlDocument
		$xmldoc.LoadXml($xmlcontent)
		$sw = New-Object System.IO.StringWriter
		$writer = New-Object System.Xml.XmlTextwriter($sw)
		$writer.Formatting = [System.XML.Formatting]::Indented
		$xmldoc.WriteContentTo($writer)
		$sw.ToString()
	}
	
	# Modify Configuration File on Local and Remote Management Servers
	function Modify-ConfigServiceConfigFile
	{
		param
		(
			[Parameter(Mandatory = $true,
					   Position = 1)]
			[string]$NewServerName,
			[Parameter(Mandatory = $true,
					   Position = 2)]
			[string]$NewDatabaseName
		)
		
		[xml]$result = (Get-Content "$((Get-ItemProperty 'HKLM:\SOFTWARE\Microsoft\Microsoft Operations Manager\3.0\Setup').InstallDirectory)ConfigService.Config")
		$xmlCmdb = ($result.Config.Component.Instance.Category | Where { $_.Name -eq 'Cmdb' }).Setting | Where { $_.Name -match "^ServerName|^DatabaseName" }
		$oldvalue1 = ($xmlCmdb | Where { $_.Name -eq 'ServerName' }).Value
		($xmlCmdb | Where { $_.Name -eq 'ServerName' }).Value = "$NewServerName"
		$oldvalue2 = ($xmlCmdb | Where { $_.Name -eq 'DatabaseName' }).Value
		($xmlCmdb | Where { $_.Name -eq 'DatabaseName' }).Value = "$NewDatabaseName"
		$xmlConfigStore = ($result.Config.Component.Instance.Category | Where { $_.Name -eq 'ConfigStore' }).Setting | Where { $_.Name -match "^ServerName|^DatabaseName" }
		$oldvalue3 = ($xmlConfigStore | Where { $_.Name -eq 'ServerName' }).Value
		($xmlConfigStore | Where { $_.Name -eq 'ServerName' }).Value = "$NewServerName"
		$oldvalue4 = ($xmlConfigStore | Where { $_.Name -eq 'DatabaseName' }).Value
		($xmlConfigStore | Where { $_.Name -eq 'DatabaseName' }).Value = "$NewDatabaseName"
		$result.Save("$(Resolve-Path (Get-ItemProperty 'HKLM:\SOFTWARE\Microsoft\Microsoft Operations Manager\3.0\Setup').InstallDirectory)ConfigService.config")
		return @"
	$env:COMPUTERNAME
                Updated File: $(Resolve-Path (Get-ItemProperty 'HKLM:\SOFTWARE\Microsoft\Microsoft Operations Manager\3.0\Setup').InstallDirectory)ConfigService.config
                    Cmdb
                        ServerName = $oldvalue1 -> $NewServerName
                        DatabaseName = $oldvalue2 -> $NewDatabaseName

                    ConfigStore
                        ServerName = $oldvalue3 -> $NewServerName
                        DatabaseName = $oldvalue4 -> $NewDatabaseName
"@
	}
	$invokeModifyConfigFile = "function Modify-ConfigServiceConfigFile { ${function:Modify-ConfigServiceConfigFile} }"
	
	function Update-LocalManagementServersConfigFile
	{
		if ($checkboxUpdateLocalManagement.Checked)
