			$text = "Updating ConfigService.config file on: $env:COMPUTERNAME"
			$toolstripstatusStep.Visible = $true
			$toolstripstatusStep.Text = $text
			Write-ActivityLog $text
			Add-JobTracker -ArgumentList $invokeModifyConfigFile, $newopsMgrSQLInstanceTextBox.Text, $newopsMgrSQLDBTextBox.Text -Name 'UpdateJob' `
						   -JobScript {
				Param ($script,
					$opsSQLinstance,
					$opsSQLdb) #Pass any arguments using the ArgumentList parameter
				#Important: Do not access form controls from this script block.
				
				. ([ScriptBlock]::Create($script)) #Important: Do not access form controls from this script block.)
				Modify-ConfigServiceConfigFile -NewServerName $opsSQLinstance -NewDatabaseName $opsSQLdb
				exit 0
			}`
						   -CompletedScript {
				Param ($Job)
				$mainResults = Receive-Job -Job $Job
				if ($mainResults)
				{
					Write-ActivityLog $mainResults
				}
				else
				{
					Write-ActivityLog "Empty results! Something is wrong!" -IsError
				}
				$text = "Completed modifying ConfigService.config file on: $env:COMPUTERNAME"
				$toolstripstatusStep.Visible = $true
				$toolstripstatusStep.Text = $text
				Write-ActivityLog $text
				
				$toolstripprogressbar1.Value = 15
				Update-LocalManagementServersRegistry
