			$text = "'Checked' checkbox to Update the Operations Manager SQL Database Configuration."
			$toolstripstatusStep.Visible = $true
			$toolstripstatusStep.Text = $text
			Write-ActivityLog $text
			$text = "Updating the Operations Manager Database Configuration"
			$toolstripstatusStep.Text = $text
			Write-ActivityLog $text
			$toolstripprogressbar1.Value = 77
			Update-OperationsManagerDatabaseConfiguration
			$toolstripprogressbar1.Value = 80
