	# Modify Registry on Local and Remote Management Servers
	function Modify-RegistrySCOM
	{
		param
		(
			[Parameter(Mandatory = $true,
					   Position = 1)]
			[string]$NewOpsDBServerName,
			[Parameter(Mandatory = $true,
					   Position = 2)]
			[string]$NewOpsDBDatabaseName,
			[Parameter(Mandatory = $true,
					   Position = 3)]
			[string]$NewDWServerName,
			[Parameter(Mandatory = $true,
					   Position = 4)]
			[string]$NewDWDatabaseName
		)
		# OpsDB Section
		Set-ItemProperty "HKLM:\SOFTWARE\Microsoft\System Center\2010\Common\Database" -Name DatabaseServerName -Value $NewOpsDBServerName
		Set-ItemProperty "HKLM:\SOFTWARE\Microsoft\System Center\2010\Common\Database" -Name DatabaseName -Value $NewOpsDBDatabaseName
		
		Set-ItemProperty 'HKLM:\SOFTWARE\Microsoft\Microsoft Operations Manager\3.0\Setup' -Name DatabaseServerName -Value $NewOpsDBServerName
		Set-ItemProperty 'HKLM:\SOFTWARE\Microsoft\Microsoft Operations Manager\3.0\Setup' -Name DatabaseName -Value $NewOpsDBDatabaseName
		
		#DW Section
		Set-ItemProperty 'HKLM:\SOFTWARE\Microsoft\Microsoft Operations Manager\3.0\Setup' -Name DataWarehouseDBServerName -Value $NewDWServerName
		Set-ItemProperty 'HKLM:\SOFTWARE\Microsoft\Microsoft Operations Manager\3.0\Setup' -Name DataWarehouseDBName -Value $NewDWDatabaseName
		
		return @"
	$env:COMPUTERNAME
                Updated Registry:
                    HKLM:\SOFTWARE\Microsoft\System Center\2010\Common\Database
                        DatabaseServerName = $(Get-ItemPropertyValue "HKLM:\SOFTWARE\Microsoft\System Center\2010\Common\Database" -Name DatabaseServerName) -> $NewOpsDBServerName
                        DatabaseName = $(Get-ItemPropertyValue "HKLM:\SOFTWARE\Microsoft\System Center\2010\Common\Database" -Name DatabaseName) -> $NewOpsDBDatabaseName

                    HKLM:\SOFTWARE\Microsoft\Microsoft Operations Manager\3.0\Setup
                        DatabaseServerName = $(Get-ItemPropertyValue "HKLM:\SOFTWARE\Microsoft\Microsoft Operations Manager\3.0\Setup" -Name DatabaseServerName) -> $NewOpsDBServerName
                        DatabaseName = $(Get-ItemPropertyValue "HKLM:\SOFTWARE\Microsoft\Microsoft Operations Manager\3.0\Setup" -Name DatabaseName) -> $NewOpsDBDatabaseName
                        DataWarehouseDBServerName = $(Get-ItemPropertyValue "HKLM:\SOFTWARE\Microsoft\Microsoft Operations Manager\3.0\Setup" -Name DataWarehouseDBServerName) -> $NewDWServerName
                        DataWarehouseDBName = $(Get-ItemPropertyValue "HKLM:\SOFTWARE\Microsoft\Microsoft Operations Manager\3.0\Setup" -Name DataWarehouseDBName) -> $NewDWDatabaseName
"@
	}
