	function Update-RemoteManagementServersRegistry
	{
		$text = "Updating Registry on: $script:remoteMS"
		$toolstripstatusStep.Visible = $true
		$toolstripstatusStep.Text = $text
		Write-ActivityLog $text
		if ($checkboxUpdateRemoteManagement.Checked)
