	# Modify Database Tables on the Operations Manager Databases
	function Modify-DatabaseConfigurationSCOM
	{
		param
		(
			[Parameter(Mandatory = $true,
					   Position = 1)]
			[string]$NewOpsDBServerName,
			[Parameter(Mandatory = $true,
					   Position = 2)]
			[string]$NewOpsDBDatabaseName,
			[Parameter(Mandatory = $true,
					   Position = 3)]
			[string]$NewDWServerName,
			[Parameter(Mandatory = $true,
					   Position = 4)]
			[string]$NewDWDatabaseName,
			[Parameter(Position = 5)]
			[switch]$OperationsManagerDB,
			[Parameter(Position = 6)]
			[switch]$OperationsManagerDW,
			[Parameter(Position = 7)]
			[string]$OldSQLInstance,
			[Parameter(Position = 8)]
			[string]$OldSQLDatabase
		)
		
		# OpsDB Section
		if ($OperationsManagerDB)
		{
			# Enable CLR
			$tsqlQuery1 = @"
-- Enable CLR
sp_configure 'show advanced options', 1;
"@
			# Enable CLR
			$tsqlQuery2 = @"
-- Enable CLR
RECONFIGURE;
"@
			# Enable CLR
			$tsqlQuery3 = @"
-- Enable CLR
sp_configure 'clr enabled', 1;
"@
			# Enable CLR
			$tsqlQuery4 = @"
-- Enable CLR
RECONFIGURE;
"@
			# Enable SQL Broker
			$tsqlQuery5 = @"
-- Enable SQL Broker
ALTER DATABASE $OldSQLDatabase SET SINGLE_USER WITH ROLLBACK IMMEDIATE
ALTER DATABASE $OldSQLDatabase SET ENABLE_BROKER
ALTER DATABASE $OldSQLDatabase SET MULTI_USER
"@
			# Enable trusted binaries for CLR
			$tsqlQuery6 = @"
-- First Trusted Assembly
DECLARE @clrName1 nvarchar(4000) = 'Microsoft.EnterpriseManagement.Sql.DataAccessLayer'
PRINT N'Trusted Assembly: ' + CAST(@clrName1 AS nvarchar(120))
DECLARE @hash1 varbinary(64) = 0xEC312664052DE020D0F9631110AFB4DCDF14F477293E1C5DE8C42D3265F543C92FCF8BC1648FC28E9A0731B3E491BCF1D4A8EB838ED9F0B24AE19057BDDBF6EC;

-- Drop trusted assembly if exists
IF EXISTS (select * from sys.trusted_assemblies where description = @clrName1)
BEGIN
PRINT N' - Dropping Trusted Assembly'
EXEC SYS.sp_drop_trusted_assembly @hash1
END

--Add to trusted assembly
PRINT N' - Adding Trusted Assembly'
EXEC sys.sp_add_trusted_assembly @hash = @hash1,
                                 @description = @clrName1;

PRINT N' '
-- Second Trusted Assembly
DECLARE @clrName2 nvarchar(4000) = 'Microsoft.EnterpriseManagement.Sql.UserDefinedDataType'
PRINT N'Trusted Assembly: ' + CAST(@clrName2 AS nvarchar(120))
DECLARE @hash2 varbinary(64) = 0xFAC2A8ECA2BE6AD46FBB6EDFB53321240F4D98D199A5A28B4EB3BAD412BEC849B99018D9207CEA045D186CF67B8D06507EA33BFBF9A7A132DC0BB1D756F4F491;

-- Drop trusted assembly if exists
IF EXISTS (select * from sys.trusted_assemblies where description = @clrName2)
BEGIN
PRINT N' - Dropping Trusted Assembly'
EXEC SYS.sp_drop_trusted_assembly @hash2
END

--Add to trusted assembly
PRINT N' - Adding Trusted Assembly'
EXEC sys.sp_add_trusted_assembly @hash = @hash2,
                                 @description = @clrName2;
"@
			# Enable Fulltext Index
			$tsqlQuery7 = @"
--enable fulltext index
EXEC sp_fulltext_database 'enable'
"@
			Invoke-SqlCommand -ServerInstance $OldSQLInstance -Database $OldSQLDatabase -Query $tsqlQuery1 | Out-String -Width 4096
			Invoke-SqlCommand -ServerInstance $OldSQLInstance -Database $OldSQLDatabase -Query $tsqlQuery2 | Out-String -Width 4096
			Invoke-SqlCommand -ServerInstance $OldSQLInstance -Database $OldSQLDatabase -Query $tsqlQuery3 | Out-String -Width 4096
			Invoke-SqlCommand -ServerInstance $OldSQLInstance -Database $OldSQLDatabase -Query $tsqlQuery4 | Out-String -Width 4096
			Invoke-SqlCommand -ServerInstance $OldSQLInstance -Database $OldSQLDatabase -Query $tsqlQuery5 | Out-String -Width 4096
			Invoke-SqlCommand -ServerInstance $OldSQLInstance -Database 'master' -Query $tsqlQuery6 | Out-String -Width 4096
			Invoke-SqlCommand -ServerInstance $OldSQLInstance -Database $OldSQLDatabase -Query $tsqlQuery7 | Out-String -Width 4096
		}
	}
