			Modify-DatabaseConfigurationSCOM -OldSQLInstance $oldOpsMgrServer -OldSQLDatabase $oldOpsMgrDB -NewOpsDBServerName $opsSQLinstance -NewOpsDBDatabaseName $opsSQLdb -NewDWServerName $dwSQLinstance -NewDWDatabaseName $dwSQLdb -OperationsManagerDB
			exit 0
		}`
					   -CompletedScript {
			Param ($Job)
			$mainResults = Receive-Job -Job $Job
			
			$text = "Completed updating the Operations Manager Database Configuration: $($opsMgrSQLInstanceTextBox.Text)"
			$toolstripstatusStep.Visible = $true
			$toolstripstatusStep.Text = $text
			Write-ActivityLog $text
			
			if ($checkboxClearSCOMCache.Checked)
			{
				$text = "'Checked' checkbox to Clear SCOM Cache."
				$toolstripstatusStep.Text = $text
				Write-ActivityLog $text
				
				$text = "Clearing Operations Manager Cache on local Management Server: $env:COMPUTERNAME"
				$toolstripstatusStep.Text = $text
				Write-ActivityLog $text
				Clear-SCOMCacheLocalManagementServers
				$toolstripprogressbar1.Value = 85
			}
			
		}`
					   -UpdateScript {
			Param ($Job)
			#$results = Receive-Job -Job $Job -Keep
			$buttonStart.BackColor = 'Gray'
			$buttonStart.Enabled = $false
		}
		
	}
	
