		$Error.Clear()
		Stop-Job -Name 'GetMSConfiguration_Job' -ErrorAction SilentlyContinue
		Remove-Job -Name 'GetMSConfiguration_Job' -ErrorAction SilentlyContinue
		Add-JobTracker -ArgumentList $script:currentMachine -Name 'GetMSConfiguration_Job' `
					   -JobScript {
			Param ($ComputerName) #Pass any arguments using the ArgumentList parameter
			#Important: Do not access form controls from this script block.
			$Error.Clear()
			trap
			{
				return "Error: $Error"
			}
			$ErrorActionPreference = 'Stop'
			if (($ComputerName -split "." | Select-Object -Index 0) -notmatch "^$env:COMPUTERNAME`$")
			{
				return Invoke-Command -ComputerName $ComputerName -ScriptBlock {
					$result = @()
					$resultoutput = ((Get-Content "$((Get-ItemProperty 'HKLM:\SOFTWARE\Microsoft\Microsoft Operations Manager\3.0\Setup').InstallDirectory)ConfigService.Config") | Out-String)
					$resultpath = "$(Resolve-Path (Get-ItemProperty 'HKLM:\SOFTWARE\Microsoft\Microsoft Operations Manager\3.0\Setup').InstallDirectory)ConfigService.config"
					$result = $resultoutput + $resultpath
					return $result
				}
			}
			else
			{
				$result = @()
				$resultoutput = ((Get-Content "$((Get-ItemProperty 'HKLM:\SOFTWARE\Microsoft\Microsoft Operations Manager\3.0\Setup').InstallDirectory)ConfigService.Config") | Out-String)
				$resultpath = "$(Resolve-Path (Get-ItemProperty 'HKLM:\SOFTWARE\Microsoft\Microsoft Operations Manager\3.0\Setup').InstallDirectory)ConfigService.config"
				$result = $resultoutput + $resultpath
				return $result
			}
		}`
					   -CompletedScript {
			Param ($Job)
			$script:mainResults = Receive-Job -Job $Job
			
			if ($script:mainResults -match "^Error")
			{
				Write-ActivityLog "Failed to gather data for Configuration File, try again! $script:mainResults" -NoConsoleOutput -IsError
				Write-Warning "Failed to gather data for Configuration File, try again! $script:mainResults"
				#CMDB
				# ServerName
				$cmdbServerNameTextBox.Text = $script:UnableToProcessXML
				
				# DatabaseName
				$cmdbDBNameTextBox.Text = $script:UnableToProcessXML
				
				#ConfigStore
				# ServerName
				$configStoreServerNameTextBox.Text = $script:UnableToProcessXML
				
				# DatabaseName
				$configStoreDBNameTextBox.Text = $script:UnableToProcessXML
			}
			else
			{
				if ($script:mainResults)
				{
					try
					{
						$importantInfoTextBox.Text = $script:mainResults.Split("`n`r") | Select-Object -SkipLast 1 | Out-String | Format-XML -ErrorAction Stop
					}
					catch
					{
						$importantInfoTextBox.Text = $script:mainResults
					}
					
					$configFileLocation = $script:mainResults.Split("`n`r") | Select-Object -Last 1
					
					$locationLabel.Text = "$configFileLocation"
					$locationLabel.Enabled = $true
				}
				$Error.Clear()
				try
				{
					$xmlObject = (($importantInfoTextBox.Text | Select-XML -ErrorAction Stop -XPath Config/Component/Instance/Category).Node)
					
					$cmdb = ($xmlObject | Where-Object { $_.Name -eq 'Cmdb' }).Setting | Where { $_.Name -eq 'ServerName' -or $_.Name -eq 'DatabaseName' } | Sort-Object
					
					$configStore = ($xmlObject | Where-Object { $_.Name -eq 'ConfigStore' }).Setting | Where { $_.Name -eq 'ServerName' -or $_.Name -eq 'DatabaseName' } | Sort-Object
					
					#CMDB
					# ServerName
					$cmdbServerNameTextBox.Text = ($cmdb | Select-Object -Index 0).Value
					
					# DatabaseName
					$cmdbDBNameTextBox.Text = ($cmdb | Select-Object -Index 1).Value
					
					#ConfigStore
					# ServerName
					$configStoreServerNameTextBox.Text = ($configStore | Select-Object -Index 0).Value
					
					# DatabaseName
					$configStoreDBNameTextBox.Text = ($configStore | Select-Object -Index 1).Value
					$NotepadButton.Enabled = $true
				}
				catch
				{
					Write-ActivityLog "Failed to gather data, try again! $error"
					#CMDB
					# ServerName
					$cmdbServerNameTextBox.Text = $script:UnableToProcessXML
					
					# DatabaseName
					$cmdbDBNameTextBox.Text = $script:UnableToProcessXML
					
					#ConfigStore
					# ServerName
					$configStoreServerNameTextBox.Text = $script:UnableToProcessXML
					
					# DatabaseName
					$configStoreDBNameTextBox.Text = $script:UnableToProcessXML
				}
			}
			$importantInfoTextBox.SelectionStart = 0;
			$importantInfoTextBox.SelectionLength = 0;
			$importantInfoTextBox.ScrollToCaret();
			$computerName.Visible = $true
			$computerName.Text = $script:currentMachine
			$buttonViewConfigurationFile.Enabled = $true
			$SaveButton.Enabled = $true
		}`
					   -UpdateScript {
			Param ($Job)
			if ($formViewConfigurationFil.Enabled)
			{
