	$searchboxText_TextChanged = {
		#TODO: Place custom script here
		$script:searchIndex = 0
	}
	
	$searchButton_Click = {
		#TODO: Place custom script here
		try
		{
			$searchText = $searchboxText.Text.Replace('\', '\\')
			$foundIndexes = ($importantInfoTextBox.Text | Select-String $searchText -AllMatches -ErrorAction Stop).Matches.Index
		}
		catch
		{
			$foundIndexes = '-1'
		}
		if ($script:searchIndex -eq $foundIndexes.Count)
		{
			$script:searchIndex = 0
		}
		
		try
		{
			$pos = $foundIndexes | Select-Object -ErrorAction Stop -Index $script:searchIndex
			if ($pos)
			{
				if ($pos -ne -1)
				{
					$importantInfoTextBox.SelectionStart = $pos;
					$importantInfoTextBox.SelectionLength = $searchboxText.Text.Length;
					$importantInfoTextBox.ScrollToCaret();
					$searchIconResultFailure.Visible = $false
					$searchIconResultPass.Visible = $true
					$labelConfigLine.Visible = $true
					$labelConfigLine.Text = "$($labelConfigLine.Tag)`: $($importantInfoTextBox.GetLineFromCharIndex($pos) + 1)"
				}
				else
				{
					$labelConfigLine.Visible = $false
					$searchIconResultFailure.Visible = $true
					$searchIconResultPass.Visible = $false
				}
				$script:searchIndex++
				$script:searchIndex = $script:searchIndex
			}
			else
			{
				$labelConfigLine.Visible = $false
				$searchIconResultFailure.Visible = $true
				$searchIconResultPass.Visible = $false
			}
		}
		catch
		{
			$labelConfigLine.Visible = $false
			$searchIconResultFailure.Visible = $true
			$searchIconResultPass.Visible = $false
		}
		
	}
	
