					   -JobScript {
			Param ($ComputerName) #Pass any arguments using the ArgumentList parameter
			#Important: Do not access form controls from this script block.
			$Error.Clear()
			trap
			{
				return "Error: $Error"
			}
			$ErrorActionPreference = 'Stop'
			if (($ComputerName -split "." | Select-Object -Index 0) -notmatch "^$env:COMPUTERNAME`$")
			{
				Invoke-Command -ComputerName $ComputerName -ErrorAction Stop -ScriptBlock {
					$path1 = "HKLM:\SOFTWARE\Microsoft\System Center\2010\Common\Database"
					$1 = Get-ItemProperty $path1 | Select-Object * -ExcludeProperty PSChildName, PSParentPath, PSDrive, PSProvider
					$path2 = "HKLM:\SOFTWARE\Microsoft\Microsoft Operations Manager\3.0\Setup"
					$2 = Get-ItemProperty $path2 | Select-Object * -ExcludeProperty PSChildName, PSParentPath, PSDrive, PSProvider
					
					
					return [PSCustomObject]@{ MicrosoftOpsMgrDBServerName = $2.DatabaseServerName; MicrosoftOpsMgrDBName = $2.DatabaseName; DataWarehouseDBName = $2.DataWarehouseDBName; DataWarehouseDBServerName = $2.DataWarehouseDBServerName; SystemCenterOpsMgrDBServerName = $1.DatabaseServerName; SystemCenterOpsMgrDB = $1.DatabaseName; }
				}
			}
			else
			{
				$path1 = "HKLM:\SOFTWARE\Microsoft\System Center\2010\Common\Database"
				$1 = Get-ItemProperty $path1 | Select-Object * -ExcludeProperty PSChildName, PSParentPath, PSDrive, PSProvider
				$path2 = "HKLM:\SOFTWARE\Microsoft\Microsoft Operations Manager\3.0\Setup"
				$2 = Get-ItemProperty $path2 | Select-Object * -ExcludeProperty PSChildName, PSParentPath, PSDrive, PSProvider
				
				
				return [PSCustomObject]@{ MicrosoftOpsMgrDBServerName = $2.DatabaseServerName; MicrosoftOpsMgrDBName = $2.DatabaseName; DataWarehouseDBName = $2.DataWarehouseDBName; DataWarehouseDBServerName = $2.DataWarehouseDBServerName; SystemCenterOpsMgrDBServerName = $1.DatabaseServerName; SystemCenterOpsMgrDB = $1.DatabaseName; }
			}
		}`
